function Index() {
    fetch('http://localhost:8080/json').then(r => r.json()).then(r => {
        return (
            <div>
                <h1>{r.id}</h1>
                <h1>{r.code}</h1>
                <h1>{r.nickname}</h1>
            </div>
        )
    })
}
console.log(Index)
export default Index
